import React from "react";

function Payment() {
    return (
        <div>
            <div class="container">
                <div class="d-flex flex-column">
                    <div id="address" class="p-2">

                    </div>
                    <div id="items" class="p-2">
                        <div class="d-flex flex-column">
                            <div class="p-2">
                                <div class="d-flex flex-row">
                                    <div class="p-2">
                                        <img src=""/>
                                    </div>
                                    <div class="p-2">
                                        <p>asdasdasdasdasdasdasd</p>
                                    </div>
                                </div>
                            </div>

                            <div class="p-2">
                                <div class="d-flex flex-row">
                                    <div class="p-2">
                                        <img src=""/>
                                    </div>
                                    <div class="p-2">
                                        <p>asdasdasdasdasdasdasd</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div id="qrcodeandpaymentdetail" class="p-2">
                        <div class="d-flex flex-row">
                            <div class="p-2">
                                <img src=""/>
                            </div>
                            <div class="p-2">
                                <p>asdasdasdasdasdasdasd</p>
                            </div>
                        </div>
                    </div>
                    <div id="totalconfirm" class="p-2">
                        <div class="d-flex flex-row justify-content-end">
                            <div class="p-2">
                                <h2>Price:12000</h2>
                            </div>
                            <div class="p-2">
                                <a class="navbar-brand" href="#"><button type="button" class="btn btn-success">Checkout</button></a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default styled(Payment)`
@media only screen and (max-width: 1140px) {
    #navbottom {
      display: none;
    }
    #navtop {
      display: none;
    }
    #bag2 {
      display: block;
    }
  }
  @media only screen and (min-width: 1140px) {
    #navbotton {
      display: block;
    }
    #navtop {
      display: block;
    }
    #bag2 {
      display: none;
    }
  }
  html {
    background-color: #f3f3f3;
  }
  body {
    background-color: #f3f3f3;
  }
  #footer-left {
    float: left;
  }
  #footer-right {
    float: right;
  }
  #navtop {
    background-color: white;
  }
  #logo {
    margin: 0 20px 0 70px;
    background-color: white;
  }
  #navbotfirstitem {
    margin-left: 60px;
  }
  #body {
    background-color: #f3f3f3;
  }
  #paymentBody {
    background-color: white;
    margin-top: 20px;
    text-decoration:bold;
  }
  #summaryBody {
    background-color: white;
    margin-top: 20px;
  }
  #logo2 {
    display: none;
  }
  #rectangle {
    width: 300px;
    height: 300px;
  }
  
`;
